import React from 'react';
import './Project.css'; // Import your CSS for styling

const Project = () => {
  const projects = [
    {
      id: 1,
      imageUrl: 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d6cca9b9-2c7e-4229-a957-4183e5d66721/dglcqrn-428b037f-681b-4902-801d-2244f1dde5ae.png/v1/fill/w_1280,h_720,q_80,strp/mileena_s_tactic_by_coolblack009_dglcqrn-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..jjItkl35ZaxUlw7i_OnbdqfXnSPhM3MfRc8wHGL6lO8', // Stock image placeholder
      shortDescription: 'Billboard Hot 100 Analysis.',
      longDescription: 'This project involves creating a dynamic and responsive web application with React.',
      githubLink: 'https://github.com/your-repo/project1',
    },
    {
      id: 2,
      imageUrl: 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d6cca9b9-2c7e-4229-a957-4183e5d66721/dglcqrn-428b037f-681b-4902-801d-2244f1dde5ae.png/v1/fill/w_1280,h_720,q_80,strp/mileena_s_tactic_by_coolblack009_dglcqrn-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..jjItkl35ZaxUlw7i_OnbdqfXnSPhM3MfRc8wHGL6lO8',
      shortDescription: 'Billboard Hot 100 Analysis.',
      longDescription: 'I analyzed the Billboard Hot 100 over decades(1970-2024). The process involved using Pythons Pandas library to put the data into an easy-to-read data frame.',
      githubLink: 'https://github.com/your-repo/project2',
    },
    {
      id: 3,
      imageUrl: 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d6cca9b9-2c7e-4229-a957-4183e5d66721/dglcqrn-428b037f-681b-4902-801d-2244f1dde5ae.png/v1/fill/w_1280,h_720,q_80,strp/mileena_s_tactic_by_coolblack009_dglcqrn-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..jjItkl35ZaxUlw7i_OnbdqfXnSPhM3MfRc8wHGL6lO8',
      shortDescription: 'A UI-focused project.',
      longDescription: 'An interactive web design project focused on UX and responsive design principles.',
      githubLink: 'https://github.com/your-repo/project3',
    },
    {
      id: 4,
      imageUrl: 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d6cca9b9-2c7e-4229-a957-4183e5d66721/dglcqrn-428b037f-681b-4902-801d-2244f1dde5ae.png/v1/fill/w_1280,h_720,q_80,strp/mileena_s_tactic_by_coolblack009_dglcqrn-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..jjItkl35ZaxUlw7i_OnbdqfXnSPhM3MfRc8wHGL6lO8',
      shortDescription: 'An API project.',
      longDescription: 'Building and consuming RESTful APIs with various data structures and algorithms.',
      githubLink: 'https://github.com/your-repo/project4',
    },
    {
      id: 5,
      imageUrl: 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d6cca9b9-2c7e-4229-a957-4183e5d66721/dglcqrn-428b037f-681b-4902-801d-2244f1dde5ae.png/v1/fill/w_1280,h_720,q_80,strp/mileena_s_tactic_by_coolblack009_dglcqrn-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..jjItkl35ZaxUlw7i_OnbdqfXnSPhM3MfRc8wHGL6lO8',
      shortDescription: 'A mobile app project.',
      longDescription: 'A mobile-first design for an app that integrates with social media APIs.',
      githubLink: 'https://github.com/your-repo/project5',
    },
    {
      id: 6,
      imageUrl: 'https://images-wixmp-ed30a86b8c4ca887773594c2.wixmp.com/f/d6cca9b9-2c7e-4229-a957-4183e5d66721/dglcqrn-428b037f-681b-4902-801d-2244f1dde5ae.png/v1/fill/w_1280,h_720,q_80,strp/mileena_s_tactic_by_coolblack009_dglcqrn-fullview.jpg?token=eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..jjItkl35ZaxUlw7i_OnbdqfXnSPhM3MfRc8wHGL6lO8',
      shortDescription: 'An automation project.',
      longDescription: 'Using Selenium to automate tasks and interactions with web pages.',
      githubLink: 'https://github.com/your-repo/project6',
    },
  ];

  return (
    <div className="project-container">
      <h1 className="projects-header">My Projects</h1>
      <div className="projects-grid">
        {projects.map((project) => (
          <div key={project.id} className="project-card">
            <img src={project.imageUrl} alt={`Project ${project.id}`} className="project-image" />
            <div className="project-info">
              <p className="project-short-desc">{project.shortDescription}</p>
              <p className="project-long-desc">{project.longDescription}</p>
              <a
                href={project.githubLink}
                target="_blank"
                rel="noopener noreferrer"
                className="project-link"
              >
                View on GitHub
              </a>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Project;
